    return (
        <div>
            <table>
                <tr>
                  <th>id</th>
                  <th>Tên SV</th> 
                  <th>mã sv</th>
                </tr>
                <tr>
                    {todos.map(todo => (
                    <td key={todo.id}>{todo.id}</td>
                    
                    ))}
                </tr>
            </table>
        </div>
    );
}

